import Stack from '@mui/material/Stack';

function About() {


    return (
        <div>
            <Stack alignItems="center">
                <h1>About</h1>
                <h3 style={{ marginLeft: "200px", marginRight: "200px", alignItems: "center", height: "525px", width: "700px"}}>The Wars of the Roses was a series of civil conflicts between the years of 1455 and 1487, starting shortly after the Hundred Years War, a series of conflicts with the French leaving the weak King Henry VI in a vulnerable position, as a cousin of Henry's, Richard of York, also with a claim to the English throne, opposed Henry, his wife, Margaret of Anjou, and his allies. Henry, with his "Lancastrian" allies clashed with Richard and his "Yorkist" allies in the conflict that changed English royalty forever.</h3>
            </Stack>
        </div>
    )
}

export default About
